VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Depression On this page What is depression? Where can I learn more about depression? Why is NIMH studying depression? How is NIMH research addressing this critical topic? Explore clinical trials about depression Share outreach materials about depression Find help and support Additional federal resources Sign up for email updates about depression What is depression? Everyone feels sad or low sometimes, but these feelings usually pass with time. Depression (also called major depressive disorder or clinical depression) is different. It can cause severe symptoms that affect how you feel, think, and handle daily activities, such as sleeping, eating, or working. It is an illness that can affect anyone‚Äîregardless of age, race, income, culture, or education. Research suggests that genetic, biological, environmental, and psychological factors play a role in depression. Where can I learn more about depression?', '{-0.5730141401290894,-0.3832596242427826,0.6248551607131958,-0.8229178786277771,-0.3824005722999573,0.6551433801651001,-0.42329642176628113,-0.25512754917144775,0.2067568153142929,-0.4589398205280304,0.3147803843021393,0.17099398374557495,-0.07348262518644333,-0.12326992303133011,-0.5431400537490845,0.1741325855255127,1.3536994457244873,0.4674096703529358,-0.046757519245147705,0.5448163151741028,-0.6966328620910645,-0.5283140540122986,-0.44906800985336304,-0.8154157996177673,-0.2806366980075836,0.03554749861359596,-0.7659770250320435,-0.9484023451805115,-0.5798887014389038,0.29887598752975464,-0.34330254793167114,0.44029122591018677,0.22102651000022888,0.18085269629955292,0.10806373506784439,-0.11526484787464142,-0.5716566443443298,0.09194759279489517,0.910814642906189,-0.1310623288154602,0.09529605507850647,-0.6449059247970581,-0.5778627991676331,1.4413259029388428,-0.44420796632766724,0.07157191634178162,0.19981159269809723,0.34238335490226746,0.66548752784729,-0.24291129410266876,0.143111675