VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Anxiety Disorders On this page What is anxiety? Where can I learn more about anxiety disorders? Why is NIMH studying anxiety disorders? How is NIMH research addressing this critical topic? Explore clinical trials about anxiety disorders Share outreach materials about anxiety disorders Find help and support Additional federal resources Sign up for email updates about anxiety disorders What is anxiety? Feeling anxious is a normal part of life. Many people worry about things such as health, money, school, work, or family. But anxiety disorders involve more than occasional worry or fear. For people with these disorders, anxiety does not go away, is felt in many situations, and can get worse over time.There are several types of anxiety disorders, including:Generalized anxiety disorderPanic disorderSocial anxiety disorderVarious phobia-related disorders Where can I learn more about anxiety disorders?', '{-0.8358145356178284,-0.5716868042945862,0.33186203241348267,-0.939603865146637,0.16775929927825928,0.31161046028137207,-0.3321322500705719,-0.3659510910511017,-0.2728530466556549,-0.8018754720687866,0.286283940076828,0.4611387848854065,0.1698070913553238,-0.6115862727165222,-0.6492542624473572,0.06215829774737358,0.2854436933994293,0.26381468772888184,-0.46806979179382324,0.7147645950317383,-0.2328174114227295,-0.7015314102172852,-0.5597307682037354,-0.41743579506874084,0.13309063017368317,-0.7565903067588806,-0.39522165060043335,-0.6781282424926758,-0.6893789172172546,0.5132482647895813,0.010539188981056213,0.08835458755493164,0.04389870911836624,-0.13838404417037964,-0.03408665955066681,-0.412829726934433,-0.42945045232772827,0.2753896117210388,0.269540011882782,0.09461136907339096,0.4704645574092865,-0.39546313881874084,-0.6317160725593567,0.3641056716442108,-0.0058573451824486256,0.11284425109624863,0.37100791931152344,0.505881667137146,0.18445055186748505,0.3835998773574829,-0.17495037615299225,-