VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'symptoms can interfere with everyday activities, relationships, and work or school responsibilities. Some people may also experience stigma related to their symptoms, which can keep them from seeking the help they need.Bipolar disorder usually requires lifelong treatment, but an effective treatment plan can help people manage their symptoms and improve their quality of life. How is NIMH research addressing this critical topic? NIMH supports research to understand the biological, genetic, and environmental factors that contribute to bipolar disorder. This research includes studies examining how different factors influence when bipolar disorder symptoms appear and how they change over time. Other research focuses on identifying patterns in brain activity that could help predict and track symptom progression.NIMH also supports research to improve treatments for people with bipolar disorder.', '{0.2225487381219864,-0.32966703176498413,0.7205915451049805,-0.10433173924684525,0.11568846553564072,0.6661846041679382,-0.017734991386532784,-0.28546231985092163,-0.191738098859787,-0.34512338042259216,0.1796509325504303,-0.12095822393894196,-0.2223697006702423,-0.24226078391075134,-0.3625018000602722,0.28099045157432556,0.7521468997001648,0.7015833854675293,0.08175932615995407,-0.19921709597110748,-0.27315813302993774,-0.2738845646381378,-0.4600721001625061,-0.9080042243003845,0.006926978472620249,-0.014921549707651138,-0.2656910717487335,-0.6878330111503601,0.027012625709176064,0.6809245944023132,-0.26849091053009033,-0.1789962351322174,0.05056767165660858,0.44168028235435486,0.10308638215065002,-0.5159884691238403,0.3079020082950592,1.099450945854187,0.7927898168563843,0.2598612308502197,-0.5528395175933838,-0.6204001307487488,-0.23664820194244385,0.3925912082195282,0.14660875499248505,-0.17953763902187347,-0.2516462802886963,0.3914882242679596,0.7158061861991882,0.1446700394153595,0.3993658721446991,-0.4