VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Cardiovascular disease can refer to a number of conditions: Heart disease Heart and blood vessel disease, also called heart disease,¬†includes numerous problems, many of which are related to atherosclerosis. Atherosclerosis is a condition that develops when a substance called plaque builds up in the walls of the arteries. This buildup narrows the arteries, making it harder for blood to flow through. If a blood clot forms, it can block the blood flow. This can cause a heart attack or stroke. Heart attack A heart attack¬†occurs when the blood flow to a part of the heart is blocked by a blood clot. If this clot cuts off the blood flow completely, the part of the heart muscle supplied by that artery begins to die. Most people survive their first heart attack and return to their normal lives, enjoying many more productive years. But having a heart attack does mean that you need to make some changes.', '{-0.11470749974250793,0.5303325057029724,0.20652766525745392,0.0018766638822853565,0.0025495258159935474,0.7439592480659485,0.8638508319854736,0.219488725066185,-0.5301530957221985,-0.6619031429290771,0.23439891636371613,1.0616066455841064,-0.5083323121070862,-0.6577597856521606,-0.06789124757051468,0.2586819529533386,0.0927792340517044,0.20132514834403992,-0.11517878621816635,-0.0281106848269701,-0.24540303647518158,-0.1450764685869217,-0.5709571242332458,0.30333632230758667,0.05347190052270889,0.16502128541469574,-0.8985001444816589,-0.49028313159942627,-0.29037201404571533,-0.1467689424753189,-0.5290984511375427,-0.3142349123954773,0.02264728583395481,0.4780099093914032,0.022334707900881767,-0.44964146614074707,-0.12991000711917877,0.6873005032539368,-0.024032823741436005,0.15566906332969666,-0.2294723242521286,0.0908980742096901,0.22147998213768005,0.2613781988620758,0.04915834590792656,-0.41749751567840576,-0.11055079847574234,0.24897310137748718,-0.13109391927719116,0.8365710377693176,-0.97805428