VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'many more productive years. But having a heart attack does mean that you need to make some changes. The medications¬†and lifestyle changes¬†that your health care professional recommends may vary according to how badly your heart was damaged, and to what degree of heart disease caused the heart attack. Learn more about heart attack. Stroke An ischemic stroke, which is the most common type of stroke, occurs when a blood vessel that feeds the brain gets blocked, usually from a blood clot. When the blood supply to a part of the brain is cut off, some brain cells will begin to die. This can result in the loss of functions controlled by that part of the brain, such as walking or talking. A hemorrhagic stroke¬†occurs when a blood vessel within the brain bursts. This is most often caused by uncontrolled¬†high blood pressure. Some effects of stroke are permanent if too many brain cells die after being starved of oxygen. These cells are never replaced.', '{-0.4999634325504303,-0.08228617906570435,0.6059641242027283,-0.3092343807220459,0.18157850205898285,0.44655996561050415,0.6801286935806274,-0.3766239583492279,-0.992218017578125,-0.5681536793708801,0.45390743017196655,0.6911691427230835,-0.47108229994773865,-0.2071152925491333,-0.23378680646419525,-0.049780767410993576,0.5189999938011169,0.3858051896095276,-0.25941023230552673,0.15741375088691711,-0.43064945936203003,-0.28424638509750366,-0.5119497776031494,-0.10574648529291153,-0.025981370359659195,0.32319003343582153,-0.5820047855377197,-0.4134448766708374,-0.18785592913627625,0.06428730487823486,-1.0560798645019531,0.10962849110364914,0.07206878811120987,0.92854905128479,-0.06749226152896881,-0.27164891362190247,-0.5142552852630615,0.42265784740448,0.4460894465446472,-0.11034054309129715,-0.05956398323178291,-0.2100176066160202,0.02666374482214451,0.4052548408508301,-0.1013193354010582,-0.7645359039306641,-0.31291183829307556,0.004994647577404976,0.2