VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'About Diabetes Understanding Type 1 Diabetes Type 1 diabetes is an autoimmune disease. Testing, coupled with education about diabetes symptoms and close follow-up, has been shown to enable earlier diagnosis and to prevent diabetes ketoacidosis. Image What is type 1 diabetes?When you have type 1 diabetes, your immune system mistakenly treats the beta cells in your pancreas that create insulin as foreign invaders and destroys them. When enough beta cells are destroyed, your pancreas can‚Äôt make insulin or makes so little of it that you need to take insulin to live.¬†Insulin is a hormone that helps blood glucose (blood sugar) enter your body‚Äôs cells so that it can be used as energy. If you have diabetes, blood glucose can‚Äôt enter your cells so it builds up in your bloodstream. This causes high blood glucose (hyperglycemia). Over time, high blood glucose harms your body and can lead to diabetes-related complications if not treated.', '{-0.09501901268959045,-0.9358048439025879,-0.15684039890766144,-0.01672244258224964,-0.026422424241900444,0.5996420383453369,0.48646649718284607,0.7658559679985046,0.8586274981498718,0.15530748665332794,0.5959126353263855,0.3880251944065094,-0.28149256110191345,-0.3885747492313385,-0.8020002841949463,-0.40536800026893616,0.5162734389305115,0.3764224946498871,-0.3057277500629425,0.04828287661075592,0.25611546635627747,-0.07874492555856705,-0.26717180013656616,-0.18545769155025482,-0.24586375057697296,-0.0064934794791042805,-0.711404025554657,-0.2339514046907425,0.005342049524188042,0.4280984401702881,-0.7256919741630554,0.16111917793750763,0.4135671854019165,0.7561004757881165,-0.17259694635868073,0.03965253010392189,-0.1362132728099823,0.7045850157737732,0.6386772990226746,-0.4492642879486084,0.2096349149942398,0.5420456528663635,0.29617956280708313,0.3203526437282562,-0.42964473366737366,0.4417220652103424,0.697579562664032,0.3404407501220703,0.0605449378490448,0