VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'rofessionals, to understand opportunities and roadblocks to type 1 diabetes screening and awareness.¬†The outcome of this roundtable is a report that outlines the discussion and potential opportunities for future direction. The report does not necessarily reflect official guidelines or recommendations from the American Diabetes Association or other participating organizations. Download Now Image The Honeymoon PhaseSome people with type 1 diabetes have a "honeymoon" period, a brief period of time where your body is producing enough insulin to lower blood glucose levels. The honeymoon phase usually happens after you start taking insulin and you may not need as much to manage your blood glucose. Work with your diabetes care team for treatment and care to avoid complications like hypoglycemia. A honeymoon period can last as little as a week or even up to a year. It‚Äôs important to know that the absence of symptoms doesn''t mean the diabetes is gone.', '{-0.0613880455493927,-0.9996573328971863,-0.5050073862075806,-0.10447877645492554,-0.017761996015906334,0.2649824321269989,0.48795297741889954,0.44917839765548706,0.1835116297006607,-0.4389147460460663,0.15368343889713287,0.1808214634656906,-0.3009941875934601,-0.694645881652832,-0.6661826372146606,-0.2639102637767792,0.6313142776489258,0.2892807722091675,0.3435799181461334,-0.6393705606460571,0.04985549673438072,-0.4319392442703247,-0.0159259382635355,-0.724852442741394,0.18129862844944,-0.017325231805443764,-0.5465331673622131,-0.5761374235153198,0.167446106672287,0.3950887620449066,-0.8598257899284363,0.17313526570796967,0.14737728238105774,1.0830070972442627,-0.6379817724227905,-0.7323704361915588,-0.08079611510038376,0.6081900596618652,0.024288102984428406,-0.33878329396247864,0.7475395798683167,0.7100637555122375,0.23826275765895844,0.7466410994529724,-0.5688337087631226,0.467869371175766,0.1047542616724968,-0.21014654636383057,0.27721276879310